import { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import UploadImage from "../components/UploadImage";

function Register() {
  const [form, setForm] = useState({
    firstName: "",
    lastName: "",
    email: "",
    password: "",
    phoneNumber: "",
    nic: "",
    jobPosition: "",
    age: "",
    jobStartDate: "",
    imageUrl: "",
  });

  const navigate = useNavigate();

  const handleInputChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const validateNIC = (nic) => {
    const nicPattern = /^(\d{9}[vVxX]|\d{12})$/;
    return nicPattern.test(nic);
  };

  const registerUser = () => {
    if (!validateNIC(form.nic)) {
      alert("Invalid NIC format. Must be 9 numbers + 1 letter or 12 numbers.");
      return;
    }

    fetch("http://localhost:4000/api/register", {
      method: "POST",
      headers: {
        "Content-type": "application/json",
      },
      body: JSON.stringify(form),
    })
      .then(() => {
        alert("Successfully Registered, Now Login with your details");
        navigate("/login");
      })
      .catch((err) => console.log(err));
  };

  const uploadImage = async (image) => {
    const data = new FormData();
    data.append("file", image);
    data.append("upload_preset", "inventoryapp");

    await fetch("https://api.cloudinary.com/v1_1/ddhayhptm/image/upload", {
      method: "POST",
      body: data,
    })
      .then((res) => res.json())
      .then((data) => {
        setForm({ ...form, imageUrl: data.url });
        alert("Image Successfully Uploaded");
      })
      .catch((error) => console.log(error));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
  };

  return (
    <div className="grid grid-cols-1 sm:grid-cols-2 h-screen items-center place-items-center">
      <div className="w-full max-w-md space-y-8 p-10 rounded-lg">
        <h2 className="mt-6 text-center text-3xl font-bold tracking-tight text-gray-900">
          Register your account
        </h2>
        <form className="mt-8 space-y-6" onSubmit={handleSubmit}>
          <div className="flex flex-col gap-4">
            <input name="firstName" type="text" placeholder="First Name" value={form.firstName} onChange={handleInputChange} required className="input-field" />
            <input name="lastName" type="text" placeholder="Last Name" value={form.lastName} onChange={handleInputChange} required className="input-field" />
            <input name="email" type="email" placeholder="Email address" value={form.email} onChange={handleInputChange} required className="input-field" />
            <input name="password" type="password" placeholder="Password" value={form.password} onChange={handleInputChange} required className="input-field" />
            <input name="phoneNumber" type="number" placeholder="Phone Number" value={form.phoneNumber} onChange={handleInputChange} required className="input-field" />
            <input name="nic" type="text" placeholder="NIC" value={form.nic} onChange={handleInputChange} required className="input-field" />
            <input name="jobPosition" type="text" placeholder="Job Position" value={form.jobPosition} onChange={handleInputChange} required className="input-field" />
            <input name="age" type="number" placeholder="Age" value={form.age} onChange={handleInputChange} required className="input-field" />
            <input name="jobStartDate" type="date" placeholder="Job Starting Date" value={form.jobStartDate} onChange={handleInputChange} required className="input-field" />
            <UploadImage uploadImage={uploadImage} />
          </div>
          <button type="submit" onClick={registerUser} className="submit-button">
            Sign up
          </button>
        </form>
      </div>
    </div>
  );
}

export default Register;
